import { useNavigate } from "react-router-dom";

export default function KYCStep5() {
  const navigate = useNavigate();

  const handleFinish = () => {
    alert("KYC process completed successfully!");
    navigate("/"); // Redirect to home or dashboard
  };

  return (
    <div className="h-screen flex justify-center items-center bg-gray-50">
      <div className="w-96 bg-white p-6 rounded shadow text-center">
        <h1 className="text-2xl font-bold mb-4">KYC Step 5 â€“ Completed</h1>
        <p className="mb-4">Thank you for completing the KYC process. Your documents are under verification.</p>
        <button onClick={handleFinish} className="w-full bg-blue-600 text-white p-2 rounded">Finish</button>
      </div>
    </div>
  );
}
